import React from 'react';
import { Link } from 'react-router-dom';
import './styles/Header.css';
import Logo from './styles/Images/Logo.png'; // Adjust the path to your logo image

function Header() {
  return (
    <Router>
      <div className="App">
        <Header />
        <main className="main">
          <Routes>
            <Route path="/" element={<TopContainer />} />
            <Route path="/design" element={<ImageGallery />} />
            <Route path="/theory" element={<div>Theory Page</div>} /> {/* Placeholder for Theory page */}
            <Route path="/about" element={<div>About Page</div>} /> {/* Placeholder for About page */}
          </Routes>
          <SignUp />
        </main>
      </div>
    </Router>
  );
}

export default Header;
